import { Switch, Route } from "react-router-dom";
import Dashboard from './containers/Dashboard/Dashboard';
import Planner from './containers/Planner/Planner';
import Layout from './components/Layout/Layout'

function App() {
  return (
    <Switch>
      <Route path="/overview">
        {/* <Layout> */}
        <Dashboard />
        {/* </Layout> */}
      </Route>
      <Route path="/planner">
        {/* <Layout> */}
        {/* <Planner /> */}
        {/* </Layout> */}
      </Route>
    </Switch>
  );
}

export default App;
